m\u00e9tro \u00e0 Rennes durant une journ\u00e9e en semaine et en week-end, ils permettent notamment :&lt;/p&gt;\n\n    &lt;ol&gt;\n        &lt;li&gt;&lt;strong&gt;Analyse de la Charge de Transport :&lt;/strong&gt; Ce type de graphique permet de comprendre et d'analyser la charge de transport dans la ville \u00e0 diff\u00e9rents moments de la journ\u00e9e. Il permet d'identifier les heures de pointe et les heures creuses, ce qui est essentiel pour la planification des horaires et des capacit\u00e9s de transport.&lt;/li&gt;\n        \n        &lt;li&gt;&lt;strong&gt;Optimisation des Services de Transport :&lt;/strong&gt; En comprenant les variations de fr\u00e9quentation tout au long de la journ\u00e9e, les autorit\u00e9s de transport peuvent ajuster les fr\u00e9quences de bus et de m\u00e9tro pour r\u00e9pondre \u00e0 la demande. Par exemple, augmenter le nombre de v\u00e9hicules pendant les heures de pointe pour am\u00e9liorer l'efficacit\u00e9 du syst\u00e8me.&lt;/li&gt;\n        \n        &lt;li&gt;&lt;strong&gt;Prise de D\u00e9cision Strat\u00e9gique :&lt;/strong&gt; Les donn\u00e9es de fr\u00e9quentation visualis\u00e9es sous forme de graphique aident les d\u00e9cideurs \u00e0 prendre des d\u00e9cisions strat\u00e9giques concernant les investissements dans les infrastructures de transport. Par exemple, l'expansion de certaines lignes en fonction des zones de forte fr\u00e9quentation.&lt;/li&gt;\n        \n        &lt;li&gt;&lt;strong&gt;\u00c9valuation de la Satisfaction des Usagers :&lt;/strong&gt; La fr\u00e9quentation des transports en commun est souvent li\u00e9e \u00e0 la satisfaction des usagers. En visualisant les niveaux de fr\u00e9quentation, il est possible de mieux comprendre les besoins et les pr\u00e9f\u00e9rences des passagers, ce qui peut conduire \u00e0 des am\u00e9liorations du service pour une meilleure exp\u00e9rience utilisateur.&lt;/li&gt;\n        \n        &lt;li&gt;&lt;strong&gt;Surveillance et Gestion des \u00c9v\u00e9nements Sp\u00e9ciaux :&lt;/strong&gt; Ces graphiques sont utiles lors d'\u00e9v\u00e9nements sp\u00e9ciaux ou de situations particuli\u00e8res (gr\u00e8ves, festivals, etc.) qui peuvent affecter la demande de transport en commun. La surveillance en temps r\u00e9el des niveaux de fr\u00e9quentation permet une gestion proactive de ces situations.&lt;/li&gt;\n    &lt;/ol&gt;\n&lt;/body&gt;\n&lt;/html&gt;\n"}}]}}}},{"type":"object","name":"TabPanel","id":"p1349","attributes":{"title":"Carte des stations de la ligne a","child":{"type":"object","name":"Column","id":"p1159","attributes":{"children":[{"type":"object","name":"Row","id":"p1156","attributes":{"children":[{"type":"object","name":"Figure","id":"p1054","attributes":{"width":1200,"x_range":{"type":"object","name":"DataRange1d","id":"p1055"},"y_range":{"type":"object","name":"DataRange1d","id":"p1056"},"x_scale":{"type":"object","name":"LinearScale","id":"p1064"},"y_scale":{"type":"object","name":"LinearScale","id":"p1065"},"title":{"type":"object","name":"Title","id":"p1057","attributes":{"text":"Carte des principales lignes du r\u00e9seau STAR","text_color":"olive","text_font_size":"25px","background_fill_color":"#F5F5DC","align":"center"}},"renderers":[{"type":"object","name":"TileRenderer","id":"p1081","attributes":{"tile_source":{"type":"object","name":"WMTSTileSource","id":"p1080","attributes":{"url":"https://a.basemaps.cartocdn.com/light_all/{z}/{x}/{y}.png","max_zoom":20,"attribution":"&amp;copy; &lt;a href=\"https://www.openstreetmap.org/copyright\"&gt;OpenStreetMap&lt;/a&gt; contributors &amp;copy; &lt;a href=\"https://carto.com/attributions\"&gt;CARTO&lt;/a&gt;"}}}},{"type":"object","name":"GlyphRenderer","id":"p1093","attributes":{"data_source":{"type":"object","name":"ColumnDataSource","id":"p1083","attributes":{"selected":{"type":"object","name":"Selection","id":"p1084","attributes":{"indices":[],"line_indices":[]}},"selection_policy":{"type":"object","name":"UnionRenderers","id":"p1085"},"data":{"type":"map","entries r toutes les 3 \u00e0 4 minutes pour assurer une pr\u00e9cision maximale, offrant ainsi aux utilisateurs la possibilit\u00e9 de conna\u00eetre en temps r\u00e9el la disponibilit\u00e9 des v\u00e9los dans chaque station.&lt;/p&gt;\n    \n    &lt;p&gt;Cette visualisation permet d'am\u00e9liorer l'exp\u00e9rience des utilisateurs en leur fournissant des informations utiles pour choisir une station de v\u00e9los disponible. Elle permet \u00e9galement d'identifier les quartiers de Rennes o\u00f9 la demande de v\u00e9los est souvent \u00e9lev\u00e9e par rapport \u00e0 la capacit\u00e9 des stations.&lt;/p&gt;\n    \n    &lt;p class=\"important\"&gt;Cela pourrait indiquer la n\u00e9cessit\u00e9 d'ajuster les capacit\u00e9s de stockage ou d'installer de nouvelles stations dans ces zones pour r\u00e9pondre \u00e0 la demande croissante.&lt;/p&gt;\n&lt;/body&gt;\n&lt;/html&gt;\n"}}]}}}},{"type":"object","name":"TabPanel","id":"p1351","attributes":{"title":"Frequentation des lignes du r\u00e9seau par tranche horaire","child":{"type":"object","name":"Column","id":"p1208","attributes":{"sizing_mode":"scale_width","children":[{"type":"object","name":"Row","id":"p1205","attributes":{"sizing_mode":"scale_width","children":[{"type":"object","name":"Div","id":"p1204","attributes":{"sizing_mode":"scale_width","text":"\n&lt;p&gt;&lt;b&gt;Instruction :&lt;/b&gt;&lt;/p&gt;                    \n&lt;p&gt;En cliquant sur le bouton [ \u25ba Play ], vous pourrez observer une animation illustrantl'\u00e9volution de la fr\u00e9quentation des lignes de bus par commune, toutes les 15 minutes.Le bouton [ \u25a0 Stop ] permet d'arr\u00eater l'animation. En survolant un point, vous pourrez \u00e9galement retrouver les caract\u00e9ristiques de celui-ci.&lt;/p&gt;\n&lt;p&gt;&lt;b&gt;REMARQUE : &lt;/b&gt;Chaque couleur  repr\u00e9sente une commune diff\u00e9rente que l'on peut identifier en survolant le point sur le graphique.&lt;/p&gt;"}}]}},{"type":"object","name":"Row","id":"p1206","attributes":{"sizi
